// page about

import React from 'react';
import './About.css';

export default function About() {
    return (
        <div className='about'>
            <h1 className='about_title'>Alan</h1>
            <img className='about_img' src='https://scontent.cdninstagram.com/v/t51.39111-15/339378290_226252856655531_6452741254543974723_n.jpg?_nc_cat=105&ccb=1-7&_nc_sid=5a057b&_nc_ohc=fuO1KeT_ocQAX_MCbJf&_nc_ad=z-m&_nc_cid=0&_nc_ht=scontent.cdninstagram.com&oh=02_AVCGJ6R2yPsL6yPVlF8MTexkK2fOV00JrlV9bcBR6pJ-zA&oe=64314612&ig_cache_key=MzA3Mzg0MDU5MzU5MTM2ODQ4NA%3D%3D.2-ccb7-5' alt='Alan' />
            <p className='about_description'>Soy un simple programador en aprendizaje.</p>
            <p className='about_version'>Rick and Morty app v1.0.5</p>
        </div>
    );
}
